adv.css:
& {
  display: flex;
  position: sticky;
  left: 0px;
  top: 0px;
  right: 0px;

  .shine {
    background: #f6f7f8;
    background-image: linear-gradient(to right, #f6f7f8 0%, #edeef1 20%, #f6f7f8 40%, #f6f7f8 100%);
    background-repeat: no-repeat;
    background-size: 800px 104px;
    display: inline-block;
    position: relative;

    animation-duration: 2s;
    animation-fill-mode: forwards;
    animation-iteration-count: infinite;
    animation-name: placeholderShimmer;
    animation-timing-function: linear;
  }

  @keyframes placeholderShimmer {
    0% {
      background-position: -468px 0;
    }

    100% {
      background-position: 468px 0;
    }
  }

  // &.mobile {}
  // &.desktop {}
  // &:hover {}
}

load.value:
async (f) => {
  const filter = {};

  if (f.id_pengajar) {
    filter["t_logbook_participants"] = {
      some: { id_user: parseInt(f.id_pengajar), id_logbook_role: 2 },
    };
  }

  const data = await db.t_logbook.findMany({
    orderBy: { date: "asc" },
    where: {
      id_action: 1,
      id_user: user.id,
      ...filter,
    },
    select: {
      id: true,
      date: true,
      verified: true,
      t_logbook_participants: {
        where: {
          id_logbook_role: 2,
        },
        select: {
          m_user: {
            select: {
              display_name: true,
            },
          },
        },
      },
    },
  });
  return data.map((item) => {
    const parti = item.t_logbook_participants;
    return {
      id: item.id,
      title: moment(item.date).format("DD MMMM YYYY - hh:mm"),
      status: item.verified ? "Verified" : "-",
      doctor: parti.length > 0 ? parti[0].m_user.display_name : "...",
    };
  });
}
